    false,nt"url": null,nt"notes": "This EnviroAtlas dataset describes the
    percentage of a 15-m riparian buffer that is forested. Forest is defined as Trees
    & Forest. There is a potential for decreased water quality in areas where the riparian
    buffer is less forested. The displayed line represents the center of the analyzed
    riparian buffer. The water bodies analyzed include hydrologically connected streams,
    rivers, connectors, reservoirs, lakes/ponds, ice masses, washes, locks, and rapids
    within the EnviroAtlas community area. This dataset was produced by the US EPA to
    support research and online mapping activities related to EnviroAtlas. EnviroAtlas
    (https://enviroatlas.epa.gov/EnviroAtlas) allows the user to interact with a web-based,
    easy-to-use, mapping application to view and analyze multiple ecosystem services
    for the contiguous United States. The dataset is available as downloadable data
    (https://edg.epa.gov/data/Public/ORD/EnviroAtlas) or as an EnviroAtlas map service.
    Additional descriptive information about each attribute in this dataset can be found
    in its associated EnviroAtlas Fact Sheet (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets)",nt"license_title":
